import axios from "axios";
var swearjar = require('swearjar');

const Create = () => {
    const [plates, setPlates] = useState([])
    const [id,setId] = useState( )

    useEffect(() => {
        axios.get('http://localhost:8080/plates/search/findByRegistrationplateIgnoreCase?registrationplate='+id, {mode:  'no-cors'})
            .then(res=> {
                console.log(res.data._embedded.plates)
                setPlates(res.data._embedded.plates)
            })
            .catch(err => {
                console.log(err)
            })


    }, [id])

    if (setPlates([]).length ===0){
        notAvail =false;
    }
    else {
        notAvail =true;
    }
    var swear = swearjar.profane(id)
    var profanityCheck;

    if (swear===true && notAvail ===true){
        return(
            <div className="box">
                <h2>Create a new plate</h2>
                <br/>
                <input type="text" className="registration-ui" value={id} onChange={e => setId(e.target.value)}/>
                <br/>
                <p>Please refrain from profanity</p>
            </div>)}
    else if (swear===false){
        return(
            <div className="box">
                <h2>Create a new plate</h2>
                <br/>
                <input type="text" className="registration-ui" value={id} onChange={e => setId(e.target.value)}/>
                <br/>
                <ul>
                    {
                        plates.map(plate => <li key={plate.plateid} className="registration-ui">{plate.registrationplate}</li> )
                    }
                </ul>
            </div>
        )

    }
    var notAvail
    if (typeof setPlates(0) !== 'undefined') {
        notAvail = true;
    }
    if (notAvail===true){
        return(
            <div className="box">
                <h2>Create a new plate</h2>
                <br/>
                <input type="text" className="registration-ui" value={id} onChange={e => setId(e.target.value)}/>
                <br/>
                <p>Numberplate taken</p>
            </div>)}
